#include <vector>
#include <algorithm>

using namespace std;

class Solution {
public:
    vector<int> goodSubsetofBinaryMatrix(vector<vector<int>>& grid) {
        int m = grid.size(), n = grid[0].size();
        vector<int> subset;

        // Check each possible subset
        for (int mask = 1; mask < (1 << m); ++mask) {
            bool isValid = true;
            vector<int> colSum(n, 0);
            vector<int> tempSubset;

            for (int row = 0; row < m; ++row) {
                if (mask & (1 << row)) {
                    tempSubset.push_back(row);
                    for (int col = 0; col < n; ++col) {
                        colSum[col] += grid[row][col];
                    }
                }
            }

            int subsetSize = tempSubset.size();
            for (int col = 0; col < n && isValid; ++col) {
                if (colSum[col] > subsetSize / 2) isValid = false;
            }

            if (isValid && tempSubset.size() > subset.size()) {
                subset = tempSubset;
            }
        }

        return subset;
    }
};
